import React from 'react';
import './nav.css';
import logo from './logo.svg'
import IsMobile from '../../IsMobile';

function Navbar()
{
    return(
        <div id = 'navbar-wrapper'>
            <img id = 'logo' src = {logo} />
            {!IsMobile && <ul id = "centered-navbar">
                <li>
                    <a>About</a>
                </li>
                <li>
                    <a>Register</a>
                </li>
                <li>
                    <a>Our Team</a>
                </li>
                <li>
                    <a>Volunteer</a>
                </li>
            </ul>}

        </div>
    )
}

export default Navbar
